import { useEffect, useState } from 'react';
import { artists as artistData } from '../../data/artists';
import { ArtistsStyled } from './Artists.styled';
import { FullPageComponent } from '../../components/FullPageComponent/FullPageComponent';
import FullPageRow from '../../components/FullPageComponent/FullPageRow';
import { loremIpsum, avatar, name, surname, fullname, username } from 'react-lorem-ipsum';

const Artists = (props) => {
	const [ artists, setArtists ] = useState([]);

	useEffect = (() => {
		setArtists([ artistData ]);
	},
	[ artistData ]);

	return (
		<FillPageComponent rows='auto'>
			<FullPageRow columns='100px 100px 100px 100px 100px'>
				{artists ? (
					artists.map((artistItem) => {
						<div>
							<Avatar gender='male' className='avatar' width='100' height='100' alt='Avatar' />
							<h2 className='username'>{username()}</h2>
						</div>;
					})
				) : null}
			</FullPageRow>
		</FillPageComponent>
	);
};

export default Artists;
